import React from 'react';
import './Header.css';

function Header() {
  return (
    <header className="navbar">
      <h1 className="navbar-title">The Cassette Deck</h1>
      <ul className="navbar-nav">
        <li>Home</li>
        <li>Friends</li>
        <li>Profile</li>
      </ul>
    </header>
  );
}

export default Header;
